import React, { Component } from 'react';
import API from '../../utils/api'
import Search from ''

class Table extends Component {
    state = {
        employees: [],
    };

    componentDidMount() {
        API.search()
            .then((res) => {
                this.setState({ employees: res.data.results })
            })
            .catch((err) => console.log(err));
    };





};

export default Table
